import React from "react";
import { makeStyles } from "@material-ui/styles";
import { Typography } from "@material-ui/core";
import { Card, Container } from "@material-ui/core";
import ApplyButton from "./JobProfileElements/ApplyButton";
import Titles from "./JobProfileElements";
import Pills from "./JobProfileElements";
import JobLinks from "./JobProfileElements";
import CompanyLogo from "./JobProfileElements";
import CompanyBanner from "./JobProfileElements";

const useStyles = makeStyles((theme) => ({
  card: {
    padding: theme.spacing(2),
  },
}));

const JobProfile = () => {
  const classes = useStyles();

  return (
    <Container>
      <Card className={classes.card}>
        <CompanyBanner />
        <CompanyLogo />
        <Titles />
        <JobLinks />
        <ApplyButton />
        <Pills />
      </Card>
    </Container>
  );
};

export default Jobprofile;
